function Register(props) {


  return (
    <section className="sign-up">
      <form className="sign-up__form">
        <h2 className="sign-up__title">
          Регистрация
        </h2>
        <input id="userEmail" name="userEmail" type="email" placeholder="Email" className="sign-up__input" required />
        <input id="userPassword" name="userPassword" type="password" placeholder="Пароль" className="sign-up__input sign-up__input_password" required />
        <button type="submit" className="sign-up__submit" >Зарегистрироваться</button>
        <p className="sign-up__text">
          Уже зарегистрированы? <a href="#" className="sign-up__link" >Войти</a>
        </p>
      </form>
    </section>
  );
}

export default Register;
